import React from 'react'
import styled from 'styled-components'

const topbar = () => {
  return (
    <Wrapper className='container-fluid' >
        <Options className='py-2 px-4' >
        <svg xmlns="http://www.w3.org/2000/svg" height="28" width="28"><path d="M18 38 4 24l14-14 2.1 2.1L9.7 22.5H44v3H9.7l10.4 10.4Z"/></svg>
            Back
        </Options>
    </Wrapper>
  )
}

export default topbar

const Wrapper = styled.div`
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-between;
`

const Options = styled.div`

`
